import React, { Component } from 'react';

class Login extends Component {
    state = {}

    render() {
        return (
            <div>
                <div className='navbar'>
                    <h3 className='ms-2'>
                        <img alt='logo' src='https://upload.wikimedia.org/wikipedia/commons/thumb/6/6b/WhatsApp.svg/512px-WhatsApp.svg.png' className='rounded-circle' style={{ width: 60, height: 50 }}></img>
                        WhatsApp</h3>

                </div>
            </div>
        )
    }
}

export default Login;
